def max_k_transactions(b, s, k):
    n = len(b)
    if n < 2 or k == 0:
        return list(), list()

    dp = [[0] * n for _ in range(k + 1)]
    track = [[None] * n for _ in range(k + 1)]

    for t in range(1, k + 1):
        max_diff = -b[1]
        best_buy = 1
        for i in range(1, n):
            if i < n - 1:
                if dp[t-1][i] - b[i] > max_diff:
                    max_diff = dp[t-1][i] - b[i]
                    best_buy = i
            if i > 0:
                profit = s[i] + max_diff
                if profit > dp[t][i-1]:
                    dp[t][i] = profit
                    track[t][i] = (best_buy, i)
                else:
                    dp[t][i] = dp[t][i-1]
                    track[t][i] = track[t][i-1]

    buys, sells = list(), list()
    t, i = k, n - 1
    while t > 0 and i > 0:
        pair = track[t][i]
        if pair is None:
            i -= 1
        else:
            buy, sell = pair
            if not sells or sell < sells[-1]:
                buys.append(buy)
                sells.append(sell)
                i = buy - 1
                t -= 1
            else:
                i -= 1

    return buys[::-1], sells[::-1]

